const easycache={_:null,async put(u,d){this._?.put(u,new Response(d))},async get(u){return await this._?.match(u)},async has(u){return await this._?.match(u)?!0:!1},async fetch(u,o){if(this.has(u))return await this.get(u);const r=await fetch(u,o);await this.put(u,r);return r},async fetchOverwrite(u,o){await this._?.add(new Request(u,o));return await this.get(u)},async init(n){this._=await caches.open(n)}}